import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import TextField from "@material-ui/core/TextField";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
}));

function Pos() {
  const classes = useStyles();

  return (
    <div className="container" style={menu}>
      <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid item xs={8} style={{ height: "20%" }}>
            <TextField
              id="outlined-full-width"
              label="Search Item"
              style={{ margin: 0 }}
              placeholder="item #"
              fullWidth
              margin="normal"
              InputLabelProps={{
                shrink: true,
              }}
              variant="outlined"
            />
          </Grid>
          <Grid item xs style={{ height: "200px", background: "blue" }}>
            <Paper className={classes.paper}>Total</Paper>
          </Grid>
        </Grid>
        <Grid container spacing={3}>
          <Grid
            item
            xs={8}
            style={{
              height: "600px",
              background: "green",
              position: "relative",
              top: "-110px",
            }}
          >
            <Paper className={classes.paper}>Products</Paper>
          </Grid>
          <Grid item xs style={{ height: "490px", background: "purple" }}>
            <Paper className={classes.paper}>Customer INfo</Paper>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}

const menu = {
  padding: "15px",
};

export default Pos;
